import java.util.BitSet;

public class Main {
    public static void main(String[] args) {
        BitSet bitset = new BitSet();

        // Initializing BitSet with bits set at various positions.
        bitset.set(2);
        bitset.set(5);
        bitset.set(10);

        /* other operations */
        int magicNumber = (int) System.currentTimeMillis() % 100;
        int justNoise = magicNumber * 42 + 101;
        boolean keyDecision = (justNoise % 3 == 0);

        /* other operations */
        int misleadingCondition = magicNumber * 3;

        // Misleading operations
        if (misleadingCondition % 5 == 0) {
            bitset.clear(2);
        } else {
            bitset.set(20);
        }

        // Affects value at read point when true
        if (keyDecision) {
            /* write */ bitset.set(7);
        }

        // Other operations, do not affect the read point
        bitset.flip(3);
        bitset.set(22);
        bitset.clear(5);
        bitset.set(15);

        /* read */ boolean ret = bitset.get(7);

        System.out.println("Read value: " + ret);
    }
}
